let rec top_structure_item =
  fun lexer lexbuf ->
    match MenhirInterpreter.entry 1304 lexer lexbuf with
    | N_ (N_top_structure_item, (result : (Parsetree.structure_item Location.loc list))) ->
        result
    | _ ->
        assert false

and top_structure_item_state =
  1304

and top_expr =
  fun lexer lexbuf ->
    match MenhirInterpreter.entry 1298 lexer lexbuf with
    | N_ (N_top_expr, (result : (Parsetree.expression))) ->
        result
    | _ ->
        assert false

and top_expr_state =
  1298

and parse_expression =
  fun lexer lexbuf ->
    match MenhirInterpreter.entry 1293 lexer lexbuf with
    | N_ (N_parse_expression, (result : (Parsetree.expression))) ->
        result
    | _ ->
        assert false

and parse_expression_state =
  1293

and interface =
  fun lexer lexbuf ->
    match MenhirInterpreter.entry 1288 lexer lexbuf with
    | N_ (N_interface, (result : (Parsetree.signature))) ->
        result
    | _ ->
        assert false

and interface_state =
  1288

and implementation =
  fun lexer lexbuf ->
    match MenhirInterpreter.entry 21 lexer lexbuf with
    | N_ (N_implementation, (result : (Parsetree.structure))) ->
